import React from 'react'
import Activity from './Activity';
import activityData from '../database/activityData'
import fromCountry from '../activities/fromCountry';

const ActivitySection = () => {
  const activities = activityData;
  return (
    <section>
      <h2>
        Activity Section
      </h2>
      {activities.map((activity, index) => {
        return <Activity key={index} activity={activity} getQuestion={getQuestion} />
      })}
    </section>
  )
}

export default ActivitySection
